<script>
export default {
	layout: 'seigneuror',
	head() {
		return {
			title: "Le Seigneur d'Or"
		}
	},
  data() {
    return {
		nbMap: 0,
		title: '',
		region: '',
		bleu: 'hsl(202, 87%, 58%)',
		montagne: '#565656',
		contour: '#fff',
		newStock: 'B7B8C4',
		map: [],
		information: '',
		isShowModal: false,
		nbTerritoireElfe: 0,
		nbTerritoireHomme: 0,
		nbTerritoireNain: 0,
		nbTerritoireMordor: 0,
		nbTerritoireIsengard: 0,
		nbTerritoireGobelin: 0,
		nbTerritoireAngmar: 0,

		nbPlayerElfe: 0,
		nbPlayerHomme: 0,
		nbPlayerNain: 0,
		nbPlayerMordor: 0,
		nbPlayerIsengard: 0,
		nbPlayerGobelin: 0,
		nbPlayerAngmar: 0,

		nbPlayers: 0

	}
  },
	methods: {
		getInfo(e) {
			console.log(e.target.id);
			this.title = e.target.id;
			this.region = e.target.getAttribute("aria-valuetext");
		},
		toggleModal() {
			this.isShowModal = !this.isShowModal;
		}
	},
	async fetch() {
	  this.map = await this.$http.$get('https://api.npoint.io/f07ce59550299d4c6d49');

		for (var key in this.map) {
			if (!this.map.hasOwnProperty(key)) continue;

			var obj = this.map[key];


			for (var prop in obj) {
				if (!obj.hasOwnProperty(prop)) continue;

				switch (obj[prop]) {

					case '#00bfff':
					case '#00BFFF':
						this.nbTerritoireElfe += 1;
						break;

					case '#1e90ff':
					case '#1E90FF':
						this.nbTerritoireHomme += 1;
						break;

					case '#fffc00':
					case '#FFFC00':
						this.nbTerritoireNain += 1;
						break;

					case '#db5461': 
					case '#DB5461':
						this.nbTerritoireMordor += 1;
						break;

					case '#ffffff':
					case '#FFFFFF':
						this.nbTerritoireIsengard += 1;
						break;

					case '#ff6f00':
					case '#FF6F00':
						this.nbTerritoireGobelin += 1;
						break;

					case '#c500ff':
					case '#C500FF':
						this.nbTerritoireAngmar += 1;
						break;
					default:
						break;
				}
			}

			if(!obj['players'].length > 0) continue;
			let obj2 = JSON.parse(JSON.stringify(obj['players']))
			for (var player in obj2) {
				
				switch (obj2[player]['faction']) {
					case 1:
						this.nbPlayerElfe += 1
						this.nbPlayers += 1;
						break;
					case 2:
						this.nbPlayerHomme += 1
						this.nbPlayers += 1;
						break;
					case 3:
						this.nbPlayerNain += 1
						this.nbPlayers += 1;
						break;
					case 4:
						this.nbPlayerMordor += 1
						this.nbPlayers += 1;
						break;
					case 5:
						this.nbPlayerIsengard += 1
						this.nbPlayers += 1;
						break;
					case 6:
						this.nbPlayerGobelin += 1
						this.nbPlayers += 1;
						break;
					case 7:
						this.nbPlayerAngmar += 1
						this.nbPlayers += 1;
						break;
					default:
						break;
				}
			}
		}
	}
}
</script>
